window.bookSummaryJSON = "<p>The Alaskan wilderness holds a nightmarish secret that threatens all of humanity in this epic sci-fi horror thriller. An audiobook so scary that it requires a warning label and a global phenomenon that is on track to sell more than one million ebook copies.&nbsp;</p> <p>It was supposed to be just another mission.&nbsp;</p> <p>Buried deep in the rugged Alaskan wilderness lies a secret that could alter the future of mankind - a secret that billionaire Elizabeth Grey has invested millions in solving. But when the dig goes silent and all attempts at making contact fail, an elite team of battle-hardened military contractors is brought in led by former Marine Max Ahlgren, a warrior haunted by his past.&nbsp;</p> <p>While the mission to make contact and rescue a team of scientists and engineers working on an “archeological” project seems like an easy payday, once on ground, the team discovers the grizzly truth that this is no ordinary rescue. Max and his men find themselves in the fight of their lives against a nightmarish enemy like nothing they have ever seen. In what quickly becomes a struggle for survival, the world’s greatest soldiers will encounter the universe’s ultimate terror in a battle that puts all of humanity at stake.&nbsp;</p> <p>No backup. No escape. No hope.&nbsp;</p> <p>Terrifying, visceral, and deeply moving, <i>Existential </i>is a novel that will haunt you forever.&nbsp;</p> <p>Pick up your copy now and embark on an epic journey that will leave your heart pounding with every chapter. The perfect combination of science fiction, explosive action, and intense horror, <i>Existential </i>is a roller-coaster ride of terror!&nbsp;</p> <p>Warning: This audiobook contains intense scenes of violence and horror. It isn't for the faint of heart. Listener discretion is advised.&nbsp;&nbsp;</p>"; 
